import React from 'react'
import {EachCountry} from "./EachCountry";
import useWindowDimensions from "./Helpers"
import styled, {keyframes} from "styled-components";
export class Countries extends React.Component{
    render(){
        const floating = keyframes`
            from {-webkit-transform:translate(0, 0px);}
            65% {-webkit-transform:translate(0, 50px);}
            to {-webkit-transform: translate(0, -0px);}`;
        const spinning = keyframes`
            0% {-webkit-transform: rotate(0deg);}
            100% {-webkit-transform: rotate(360deg);}`;
        const float = styled.div`
            animation: ${spinning} 4s easy-in-out infinite`;
        const mainSize = {
            width:this.props.width,
            height:this.props.height,
        };
        return(
            <float style={mainSize}>

                {this.props.data.map(
                        (each)=> <EachCountry key={each.country} objectCount={each.objectCount} objectIDs={each.objectIDs}
                        iso={each.iso} latLon={each.latLon} width={this.props.width} height={this.props.height}/>
                        )}
            </float>
        )
    }

}
